styleUrlsData.data:
.app_header {
  &__container {
    height: 7vh;
    .wrapper {
      font-family: "Nunito Sans", "Helvetica Neue", Helvetica, Arial, sans-serif;
      border-bottom: 1px solid rgba(0, 0, 0, 0.1);
      padding: 15px 20px;
      display: flex;
      align-items: center;
      justify-content: space-between;
      color: var(--color-primary);
    }
    svg {
      display: inline-block;
      vertical-align: top;
    }

    h1 {
      font-weight: 900;
      font-size: 20px;
      line-height: 1;
      margin: 6px 0 6px 10px;
      display: inline-block;
      vertical-align: top;
    }

    a {
      color: var(--color-secondary);
      font-weight: bold;
      margin: .4vmin;
    }
    button + button {
      margin-left: 10px;
    }
  }
}

